import React from 'react'
import {VeterinariansApiAxiosParamCreator, VeterinariansApiFactory} from '../json/api.ts';
import { useState } from 'react';
import { useEffect } from 'react';
import VeterinariansInfo from "../components/VeterinariansInfo.tsx";
import axios from "axios";
import { MdOutlineEdit } from "react-icons/md";


var functionFromApi = VeterinariansApiFactory(); 
function Veterinarians() {
    
    const [name, setName] = useState("");
    const [phoneNumber, setPhoneNumber] = useState("");
    const [dateOfBirth, setDateOfBirth] = useState("");
    const [education, setEducation] = useState("");
    const [data, setData] = useState([]);
    // const veterinarians = {
    //     name: name,
    //     phoneNumber: phoneNumber,
    //     dateOfBirth: dateOfBirth,
    //     education: education
    // };
    async function getVetDataFromApi() {
        const response = await functionFromApi.apiVeterinariansGet();
        const { data } = response;
        setData(data);
    }
    useEffect(() => {
        handlePutVetData();
        getVetDataFromApi();
    }, []);

    const handleDeleteVetData = (id) => {
        console.log(id);
        functionFromApi.apiVeterinariansIdDelete(id)
            .then(response => {
                if (response.status == 200) {
                    // Успешное удаление данных
                    console.log('Данные успешно удалены');
                    getVetDataFromApi();
                } else {
                    // Обработка ошибки, если требуется
                    console.log('Ошибка при удалении данных');
                }
            })
            .catch(error => {
                // Обработка ошибки, если требуется
                console.log('Ошибка при удалении данных:', error);
            });
    }

    // const handlePutVetData = async (id) => {
    //     console.log(id);
    //     fetch('https://localhost:7205/api/Veterinarians/' + id, {
    //         method: 'put',
    //         body: JSON.stringify(data),
    //         headers: {
    //             'Content-Type': 'application/json; charset=UTF-8',
    //         },
    //         })
    //         .then((response) => response.json())
    //         .then((data) => this.setState({ data }))
    //         .catch((error) => console.error(error));
    // }
    const handleSubmit = (e) => {
        e.preventDefault();
        console.log({ name, phone, date, education });
        // Отправляем запрос на сервер, заменив “your_api_url.com” на адрес вашего API
        fetch('https://localhost:7205/api/Veterinarians/' +id, {
            method: 'PUT',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ name, phone, date, education }),
        });
    };
        // const response = await functionFromApi.apiVeterinariansIdPut(id)
        //     .then(response => {
        //         if(response.status == 200) {
        //             //Успешное изменение данных
        //             console.log('Данные успешно обновлены');
        //             getVetDataFromApi();
        //         } else {
        //             // Обработка ошибки, если требуется
        //             console.log('Ошибка при изменение данных');
        //         }
        //     })
        //     .catch(error => {
        //         //Обработка ошибки, если требуется
        //         console.log('Ошибка при изменение данных', error);
        //     });
        

    


    

    return (
        <>
        <form onSubmit={(e) => handleSubmit(e)}>
            <label>Имя</label> <input type='text' value={name} onChange={(e) => setName(e.target.value)}></input>
            <br />
            <label>Телефон</label> <input type='number' value={phoneNumber} onChange={(e) => setPhone(e.target.value)}></input>
            <br />
            <label>Дата рождения</label>
            <input
                type='date'
                value={dateOfBirth.toLocaleDateString()}
                onChange={(e) =>
                setDate(new Date(e.target.value))
            }
            />
            <br />
            <label>Образование</label> <input type='text' value={education} onChange={(e) => setEducation(e.target.value)}></input>

            <button type="submit">Отправить</button>
            </form>
        </>
        // <>
        //     {/* <form onSubmit={handlePutVetData()}>
        //         <label>Name</label>
        //         <input type= 'text' value={name} onChange={(e) => setName(e.target.value)} />

        //             <label>Phone Number</label>
        //             <input type="tel" value={phoneNumber} onChange={(e) => setPhoneNumber(e.target.value)} />

        //             <label>Date of Birth</label>
        //             <input type="date" value={dateOfBirth} onChange={(e) => setDateOfBirth(e.target.value)} />

        //             <label>Education</label>
        //             <input type="text" value={education} onChange={(e) => setEducation(e.target.value)} />

        //         <button type="submit">Submit</button>
        //     </form> */}
        
        
        //     <div>
        //         Список ветеринаров:
        //         <div>
        //             {data.map(post => 
        //                 <div key = {post.id}>
        //                     <VeterinariansInfo post = {post} handleDeleteVetData={handleDeleteVetData}  handlePutVetData = {handlePutVetData}>
        //                         <form onSubmit={handlePutVetData()}>
        //                             <label>Name</label>
        //                             <input type= 'text' value={name} onChange={(e) => setName(e.target.value)} />

        //                                 <label>Phone Number</label>
        //                                 <input type="tel" value={phoneNumber} onChange={(e) => setPhoneNumber(e.target.value)} />

        //                                 <label>Date of Birth</label>
        //                                 <input type="date" value={dateOfBirth} onChange={(e) => setDateOfBirth(e.target.value)} />

        //                                 <label>Education</label>
        //                                 <input type="text" value={education} onChange={(e) => setEducation(e.target.value)} />

        //                             <button type="submit">Submit</button>
        //                         </form>    
        //                     </VeterinariansInfo>    
                            
        //                 </div>
                        
        //             )}
                    
        //         </div>
        //     </div>
        // </>
    );
}

export default Veterinarians
